How to compare a Mongo array that matches all items of another array no matter it's order in C#?<p>I was using the <code>Equals(obj)</code> method, but it's not working correctly because the array elements in the database are not ordered. If the order is different, it is not considered a matching element.</p>
<p>I tried <a href="https://stackoverflow.com/a/50017334/8604967">that solution</a> in two ways:</p>
<pre><code>var filteredObj = objects.Find(obj =&gt; obj.Elements.OrderBy(x =&gt; x).Equals(elements)).FirstOrDefault();
</code></pre>
<pre><code>var filteredObj = objects.Find(obj =&gt; obj.Elements.OrderBy(x =&gt; x).Equals(elements)).FirstOrDefault();
</code></pre>
<p>But in both of them I get the following exception:<br />
<code>Unsupported filter: {document}{Elements}.Equals(value(System.Collections.Generic.List[System.Int32]).OrderBy(x =&gt; x)).</code><br />
It seems that MongoDb Driver doesn't support that kind of thing.</p>
<p>The method responsible for that:</p>
<pre><code>public string GetIdByElements(List&lt;int&gt; elements)
{
    var filteredObj = objects.Find(obj =&gt; obj.Elements.Equals(elements)).FirstOrDefault();

    if (filteredObj is null)
        throw new ObjectNotFoundException(&quot;Object not found&quot;);
    return filteredObj.Id.ToString();
}
</code></pre>

