How to properly use $group operator in MongoDB?<p>I am currently struggling with the MongoDB query in which I want to group data by 2 fields <code>myId</code> and <code>myType</code>, but the results that I get in return don't look like what I need.
My goal is to have for each <code>myId</code> results with <code>myType</code> grouping. Like:</p>
<pre><code>myId : {myType1 : 5, myType2 : 3, myType3 : 1}
</code></pre>
<p>But when I am trying to provide query with group operator like below:</p>
<pre><code>db.collection.aggregate([{
&quot;$project&quot;: {
  &quot;myId&quot;: &quot;$myId&quot;,
  &quot;myType&quot;: &quot;$eventType&quot;,
  }
},
{
   &quot;$group&quot;:{
      &quot;_id&quot;:{
         &quot;myId&quot;:&quot;$myId&quot;,
         &quot;myType&quot;:&quot;$Type&quot;
      },
      &quot;count&quot;:{
         &quot;$sum&quot;:1
      }
   }
}
])
</code></pre>
<p>Results returned by this kind of grouping looks like this</p>
<pre><code>[{'_id': {'myId': 'qwerty123', 'myType': 'created', 'count': 1}}, 
{'_id': {'myId': qwerty123', 'myType': 'removed', 'count': 3}},
{'_id': {'myId': qwerty123', 'myType': 'updated', 'count': 2}},
{'_id': {'myId': 'asd123', 'myType': 'created', 'count': 1}}, 
{'_id': {'myId': asd123', 'myType': 'removed', 'count': 2}}]

</code></pre>
<p>But what I would like to achieve is a structure like below:</p>
<pre><code>[{'_id': {'myId': 'qwerty123', 'myType': {'created' 1, 'removed' : 3, 'updated' : 2}}},
{'_id': {'myId': 'asd123', 'myType': {'created' 1, 'removed' : 2}}}]

</code></pre>
<p>Or maybe like this:</p>
<pre><code>[{'qwerty123', 'myType': {'created' 1, 'removed' : 3, 'updated' : 2}},
{'asd123', 'myType': {'created' 1, 'removed' : 2}}]

</code></pre>
<p>Is it possible to achieve results from <code>$group</code> operator with the above schema? If yes, how can I achieve it?</p>
<p>Thank you.</p>

